(1, '<!doctype html>\r\n<html lang=\"en\">\r\n  <head>\r\n    <!-- Required meta tags -->\r\n    <meta charset=\"utf-8\">\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1, shrink-to-fit=no\">\r\n\r\n    <!-- Bootstrap CSS -->\r\n    <link rel=\"stylesheet\" href=\"https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/css/bootstrap.min.css\" integrity=\"sha384-Gn5384xqQ1aoWXA+058RXPxPg6fy4IWvTNh0E263XmFcJlSAwiGgFAW/dAiS6JXm\" crossorigin=\"anonymous\">\r\n	\r\n	<link rel=\"preconnect\" href=\"https://fonts.gstatic.com\">\r\n<link href=\"https://fonts.googleapis.com/css2?family=Poppins:wght@400;500;600;700;800&display=swap\" rel=\"stylesheet\">\r\n\r\n    <title>Privacy Policy : Somewhere Destinations</title>\r\n	\r\n	<style>\r\n	\r\n	*\r\n{\r\n  margin: 0; padding: 0;\r\n  -webkit-box-sizing: border-box;\r\n          box-sizing: border-box;\r\n\r\n}\r\n\r\nul,ol,p\r\n{\r\n   margin: 0; padding: 0;\r\n  -webkit-box-sizing: border-box;\r\n          box-sizing: border-box;\r\n}\r\n\r\na:hover { text-decoration: none; }\r\n\r\nh1,h2,h3,h4,h5,h6,p { margin: 0; padding: 0;}\r\n	\r\nbody,html\r\n{\r\n      font-family: \'Poppins\', sans-serif;\r\n      height: 100%;\r\n	  \r\n}\r\n\r\nbody\r\n{\r\n  overflow-x: hidden; background:#FFFAEACA;\r\n}\r\n\r\np {color:#5e5e5e; font-size:16px; line-height: 30px; margin-bottom:20px;}\r\n\r\nli{color:#5e5e5e; font-size:16px; line-height: 30px}\r\n\r\n.seprator{padding:20px 0px;}\r\n\r\nsection.faq { padding: 50px 0px;}\r\n\r\n\r\n	\r\nsection.faq h4{font-size:28px; color:#013666; margin-bottom:20px;  font-weight: 600;}\r\n\r\nsection.faq h5{font-size:20px; color:#F17059; margin-bottom:15px;  font-weight: 500;}\r\n\r\nul.listing-style li { list-style-type: decimal; margin-left: 15px; padding: 10px 0px; line-height: 30px; font-size: 16px;}\r\n\r\nul.listing-style li ul li {margin-left: 15px;padding: 10px 0px;line-height: 30px;font-size: 16px; list-style: disc;}\r\n\r\nul.list-style li { margin-left: 15px; padding: 10px 0px; line-height: 30px; font-size: 16px;}\r\n\r\nheader { background: rgb(1,54,103);\r\nbackground: linear-gradient(0deg, rgba(1,54,103,1) 0%, rgba(3,81,151,1) 45%); padding: 20px 0px; text-align: center;}\r\n\r\nheader p{margin:0px; color:#fff; font-size:24px; font-weight:600;}\r\n\r\nfooter {  background: #676767; padding: 20px; text-align: center; }\r\n\r\nfooter p{margin:0px; color:#fff;}\r\n	\r\n	\r\n	</style>\r\n	\r\n	\r\n  </head>\r\n  <body>\r\n  \r\n   <header>\r\n \r\n <p>Announce Me</p>\r\n \r\n </header>\r\n  \r\n  <section class=\"faq\">\r\n  \r\n  <div class=\"container\">\r\n  \r\n  <div class=\"row\">\r\n  \r\n  <div class=\"col-md-12 col-sm-12\">\r\n  \r\n  <h4>1. What information do we collect and what do we do with it?</h4>\r\n \r\n<p>When you enroll as a student or subscriber (â€œlearnerâ€) on our site, as part of the enrolling process, we collect the personal information you give us such as your name and email address.</p>\r\n<p>Email marketing: we may send you emails about our site, registration or other updates. We may also use your email to inform you about changes to the app, survey you about your usage, or collect your opinion.</p>\r\n\r\n  \r\n  <h4>2. How do you get my consent?</h4>\r\n  \r\n<p>When you provide us with personal information to become a member on our site, make a purchase, or participate in the usage, you imply that you consent to our collecting it and using it for that specific reason only.</p>\r\n<p>If we ask for your personal information for a secondary reason, like marketing, we will either ask you directly for your expressed consent, or provide you with an opportunity to say no.</p>\r\n\r\n  <h4>How do I withdraw my consent?</h4>\r\n  \r\n  <p>If after you opt-in, you change your mind, you may withdraw your consent for us to contact you, for the continued collection, use or disclosure of your information, at any time, by contacting us at\r\n  <a href=\"mailto:raymond@raymondmodglin.com\">raymond@raymondmodglin.com</a> or mailing us at:<br> 432 S. Emerson Ave #120 Greenwood IN USA 46143</p>\r\n  \r\n  <h4>3. Disclosure</h4>\r\n  <p>We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service.</p>\r\n  \r\n  <h4>4. Announce Me</h4>\r\n  \r\n  <p>Our site is hosted by Announce Me Inc. (â€œAnnounce Meâ€). They provide us with the online course creation platform that allow us to sell our product/services to you.\r\nYour data is stored through Announce Meâ€™s data storage, databases and the general Announce Me application. They store your data on a secure server behind a firewall.\r\n</p>\r\n  \r\n  <h4>Payment:</h4>\r\n  \r\n  <p>If you make a purchase on our site, we use a third party payment processor such as Stripe or Paypal. Payments are encrypted through the Payment Card Industry Data Security Standard (PCI-DSS). Your purchase transaction\r\n  data is stored only as long as is necessary to complete your purchase transaction.</p>\r\n<p>All direct payment gateways adhere to the standards set by PCI-DSS as managed by the PCI Security Standards Council, which is a joint effort of brands like Visa, MasterCard, American Express and Discover.</p>\r\n<p>PCI-DSS requirements help ensure the secure handling of credit card information by our site and related courses and its service providers.</p>\r\n\r\n<h4>5. Third Party Services</h4>\r\n\r\n<p>In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us.</p>\r\n\r\n<p>However, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.</p>\r\n\r\n<p>For these providers, we recommend that you read their privacy policies so you can understand the manner in which your personal information will be handled by these providers.</p>\r\n\r\n<p>Certain providers may be located in or have facilities that are located in a different jurisdiction than either you or us. If you elect to proceed with a transaction that involves the services of a third-party service provider, then your information may become subject to the laws of the jurisdiction(s) in which that service provider or its facilities are located.</p>\r\n\r\n<p>As an example, if you are located in Canada and your transaction is processed by a payment gateway located in the United States, then your personal information used in completing that transaction may be subject to disclosure under United States legislation, including the Patriot Act.</p>\r\n\r\n<p>Once you leave our course website or are redirected to a third-party website or application, you are no longer governed by this Privacy Policy or our websiteâ€™s Terms of Service.</p>\r\n\r\n\r\n<h4>Links</h4>\r\n\r\n<p>When you click on links on our course site, they may direct you away from our site. We are not responsible for the privacy practices of other sites and encourage you to read their privacy statements.\r\n</p>\r\n\r\n<h4>6. Security</h4>\r\n\r\n<p>To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed.</p>\r\n\r\n<p>If you provide us with your credit card information, the information is encrypted using secure socket layer technology (SSL) and stored with a AES-256 encryption.  Although no method of transmission over the Internet or electronic storage is 100% secure, we follow all PCI-DSS requirements and implement additional generally accepted industry standards.</p>\r\n\r\n<h4>Cookies</h4>\r\n\r\n<p>We collect cookies or similar tracking technologies. This means information that our websiteâ€™s server transfers to your computer. This information can be used to track your session on our website. Cookies may also be used to customize our website content for you as an individual. If you are using one of the common Internet web browsers, you can set up your browser to either let you know when you receive a cookie or to deny cookie access to your computer.</p>\r\n\r\n\r\n<ul class=\"list-style\">\r\n<li>We use cookies to recognize your device and provide you with a personalized experience.</li>\r\n<li>We also use cookies to attribute visits to our websites to third-party sources and to serve targeted ads from Google, Facebook, Instagram and other third-party vendors.</li>\r\n<li>Our third-party advertisers use cookies to track your prior visits to our websites and elsewhere on the Internet in order to serve you targeted ads. For more information about targeted or behavioral advertising,  </li>\r\n<li>Opting out: You can opt out of targeted ads served via specific third-party vendors by visiting the Digital Advertising Allianceâ€™s Opt-Out page.</li>\r\n<li>We may also use automated tracking methods on our websites, in communications with you, and in our products and services, to measure performance and engagement.</li>\r\n<li>Please note that because there is no consistent industry understanding of how to respond to â€œDo Not Trackâ€ signals, we do not alter our data collection and usage practices when we detect such a signal from your browser.</li>\r\n</ul>\r\n\r\n<h4>Web Analysis Tools</h4>\r\n\r\n<p>We may use web analysis tools that are built into the BUSINESS NAME website to measure and collect anonymous session information.</p>\r\n\r\n\r\n<h4>7. Age of Consent</h4>\r\n\r\n<p>By using this site, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence.</p>\r\n\r\n<h4>8. Changes to this Privacy Policy</h4>\r\n\r\n<p>We reserve the right to modify this privacy policy at any time, so please review it frequently. Changes and clarifications will take effect immediately upon their posting on the website. If we make material changes to this policy, we will notify you here that it has been updated, so that you are aware of what information we collect, how we use it, and under what circumstances, if any, we use and/or disclose it.\r\n</p>\r\n\r\n<p>If our site or course is acquired or merged with another company, your information may be transferred to the new owners so that we may continue to sell products to you.\r\n</p>\r\n\r\n\r\n\r\n  </div>\r\n  \r\n  \r\n  \r\n  </div>\r\n  \r\n  \r\n  \r\n  </div>\r\n  \r\n  \r\n  </section>\r\n   \r\n    <footer>\r\n  <div class=\"container\">\r\n  <p>Copyright Â© Announce Me 2020-21 | All Rights Reserved</p>\r\n  </div>\r\n  \r\n  </footer> \r\n   \r\n   \r\n\r\n    <!-- Optional JavaScript -->\r\n    <!-- jQuery first, then Popper.js, then Bootstrap JS -->\r\n   \r\n  </body>\r\n</html>', '', 1231321, NULL, NULL);
